import { Injectable } from '@nestjs/common';
import { promises as fs } from 'fs';
import * as path from 'path';

interface TodoItem {
  id: string;
  text: string;
  done: boolean;
}

@Injectable()
export class TodoService {
  private cache: TodoItem[] | null = null;

  async getTodos(): Promise<TodoItem[]> {
    if (this.cache) return this.cache;

    // Assume todo.md is located at repository root
    const todoPath = path.resolve(process.cwd(), '..', 'todo.md');
    try {
      const content = await fs.readFile(todoPath, 'utf8');
      const items = this.parse(content);
      this.cache = items;
      return items;
    } catch (err) {
      // If file not found or read error, return empty list
      this.cache = [];
      return [];
    }
  }

  private parse(content: string): TodoItem[] {
    const lines = content.split(/\r?\n/);
    const items: TodoItem[] = [];
    let idCounter = 1;
    for (const line of lines) {
      // Matches: "- [ ] Task" or "- [x] Task"
      const m = line.match(/^- \[([\sxX])\]\s*(.*)$/);
      if (m) {
        const done = m[1].toLowerCase() === 'x';
        const text = m[2].trim();
        if (text.length > 0) {
          items.push({ id: `todo-${idCounter++}`, text, done });
        }
      }
    }
    return items;
  }
}

