import React, { useEffect, useState } from 'react';
import './App.css';

type TodoItem = { id: string; text: string; done: boolean };

const App: React.FC = () => {
  const [items, setItems] = useState<TodoItem[]>([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState<string | null>(null);

  useEffect(() => {
    fetch('/api/todo')
      .then((res) => {
        if (!res.ok) throw new Error('Network response was not ok');
        return res.json();
      })
      .then((data: TodoItem[]) => {
        setItems(data);
        setLoading(false);
      })
      .catch((e) => {
        setError((e as Error).message);
        setLoading(false);
      });
  }, []);

  return (
    <div className="App">
      <header className="App-header">
        <h1>Web3 Fullstack Demo</h1>
      </header>
      <section>
        <h2>TODO (from server)</h2>
        {loading && <p>Loading...</p>}
        {error && <p style={{ color: 'red' }}>Error: {error}</p>}
        {!loading && !error && (
          <ul>
            {items.map((it) => (
              <li key={it.id}>
                <input type="checkbox" checked={it.done} readOnly /> {it.text}
              </li>
            ))}
          </ul>
        )}
      </section>
    </div>
  );
};

export default App;

